// export default ImagesPage;
import React, { useEffect, useState } from 'react';

function ImagesPage() {
  const [allImages, setAllImages] = useState([]);

  useEffect(() => {
    fetch("http://localhost:5000/imagespage")
      .then((res) => res.json())
      .then((data) => {
        console.log(data);
        setAllImages(data.data);
      });
  }, []);

  return (
    <div>
      <h1>Images Page</h1>
      {allImages.map((data, index) => (
        <img
          key={index}
          alt={`Image ${index}`}
          width={100}
          height={100}
          src={data.image}
        />
      ))}
    </div>
  );
}

export default ImagesPage;
